package swea;

import java.lang.management.ManagementPermission;
import java.util.HashMap;
import java.util.Scanner;

public class d3_1240 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in);
		int T = sc.nextInt();
		for(int t=1;t<=T;t++) {
			int N = sc.nextInt();
			int M = sc.nextInt();
			sc.nextLine();
			String[] a = new String[N];
			for(int i=0;i<N;i++) {
				a[i] = sc.nextLine();
			}
			HashMap<String, Integer> maps = new HashMap<>();
			maps.put("0001101",0);
			maps.put("0011001",1);
			maps.put("0010011",2);
			maps.put("0111101",3);
			maps.put("0100011",4);
			maps.put("0110001",5);
			maps.put("0101111",6);
			maps.put("0111011",7);
			maps.put("0110111",8);
			maps.put("0001011",9);
			int ans = 0;
			LOOP:
			for(int i=0;i<N;i++) {
				for(int j=M-1;j>=M-56;j--) {
					if(a[i].charAt(j)=='1') {
						int n = j-55;
						int sum = 0;
						int sum2 = 0;
						for(int k=1;k<=8;k++) {
							if(k%2==1) {
								sum+=3 * maps.get(a[i].substring(n+(k-1)*7,n+7+(k-1)*7));
							}else {
								sum+= maps.get(a[i].substring(n+(k-1)*7,n+7+(k-1)*7));
							}
							sum2+=maps.get(a[i].substring(n+(k-1)*7,n+7+(k-1)*7));
						}
						if(sum>0&&sum%10==0) {
							ans+=sum2;
						}
						break LOOP;
					}
				}
			}
			System.out.println("#"+t+" "+ans);
		}
	}
}


